import React, { Fragment } from 'react';
import {
  BrowserRouter as Router,
  Route,
  Switch,
  Redirect,
} from 'react-router-dom';
import { Provider } from 'react-redux';
import './App.css';
import store from './store';

import Login from './components/Auth/Login';
import SellerAdd from './components/branch/SellerAdd';
import SellerAdd_Company from './components/company/SellerAdd';
import EditingSettings from './components/Settings/EditingSettings'
import ExpensesAdd from './components/Expenses/ExpensesAdd'

const App = () => {
  return (
    <Provider store={store}>
      <Fragment>
        <Router>
          <Switch>
             <Route exact path='/login' component={Login}/>
             <Route exact path='/SellerAdd' component={SellerAdd}/>
             <Route exact path='/SellerAdd_Company' component={SellerAdd_Company}/>
             <Route exact path='/EditingSettings' component={EditingSettings}/>
             <Route exact path='/ExpensesAdd' component={ExpensesAdd}/>
            </Switch>
            </Router>
            </Fragment>
            </Provider>
  )
}


export default App;
